                    <th scope="col">#</th>
                    <th scope="col">Name</th>
                    <th scope="col">Location</th>
                    <th scope="col">Pet Type</th>
                </tr>
            </thead>
            <tbody>

            </tbody>
        </table>
    </div>
  );
}

export default Home;
